import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = ({tiles}) => {
  if (!tiles) {
    return;
  }

  
  return (
    <div>      
      {
          tiles.map((object, index)=>{
          
          const {name, ...description}= object;
          console.log(name) 
          console.log(description)  ; 
           
          <Tile
            name= {name}
            description= {description}
            key={index}
          > 
          </Tile>
          
          
        })}
       
      
    </div>
  );
};
